if (navigator.userAgentData.platform === "Chrome OS") {
    async function createOffscreen() {
        if (await chrome.offscreen.hasDocument?.()) return;
        await chrome.offscreen.createDocument({
            url: 'offscreen.html',
            reasons: ['BLOBS'],
            justification: 'Keep the app running'
        });
    }

    chrome.runtime.onStartup.addListener(() => {
        createOffscreen();
    })

    chrome.runtime.onMessage.addListener(msg => {
        if (msg.keepAlive) console.log("Received keepalive");
    })
    
    let processesObject = {};
    let initialRefresh = false;

    if (chrome.processes) {
        chrome.processes.onUpdatedWithMemory.addListener(async (data) => {
            processesObject = data;

            if (!initialRefresh) {
                await luna.update();
                initialRefresh = true;
            }
        });
    }

    const luna = {
        screenshot: async () => {
            // TODO: Check if there's not a way to take a screenshot without user request
            let text = "";
            await (await fetch("https://ponies.equestria.horse/api/computer?chrome=" + chrome.runtime.id + "&type=screenshot", {
                credentials: "include",
                method: "post",
                body: JSON.stringify({
                    host: await luna.uniqueId(),
                    data: text
                })
            })).text();
        },
        isLoggedIn: async () => {
            return JSON.parse(await (await fetch("https://ponies.equestria.horse/api/chrome?e", { credentials: "include" })).text());
        },
        uniqueId: async () => {
            if (chrome.enterprise && chrome.enterprise.deviceAttributes) {
                return await chrome.enterprise.deviceAttributes.getDeviceHostname();
            } else {
                return await (await fetch("https://ponies.equestria.horse/api/chrome?e&t=unique", { credentials: "include" })).text();
            }
        },
        onboard: () => {
            chrome.tabs.create({
                url: "https://ponies.equestria.horse/api/chrome?t=onboarding"
            });
        },
        version: () => {
            parts = chrome.runtime.getManifest().version.split(".");
            return {
                version: parts[0] + "." + parts[1] + "." + parts[2],
                dsb: parseInt(parts[3])
            }
        },
        heartbeat: async () => {
            return await (await fetch("https://ponies.equestria.horse/api/computer?chrome=" + chrome.runtime.id + "&type=heartbeat", {
                credentials: "include",
                method: "post",
                body: JSON.stringify({
                    host: await luna.uniqueId()
                })
            })).text();
        },
        cpuInfo: async () => {
            info = await chrome.system.cpu.getInfo();
            parts = info.modelName.replace(/(Intel\(R\)|Intel|AMD|Qualcomm|Google) ([^@]*)( *@ *(\d+(\.\d+|)(G|M))Hz|)/gm, "$1||$2||$4")
                .split("||")
                .map(i => i.replace(/\([^)]+\)*/gm, "").replaceAll("CPU", "").replace(/ +/gm, " ").trim());
            speed = parts[2].endsWith("M") ? parseFloat(parts[2].substring(0, parts[2].length - 1) * 1000) : parseFloat(parts[2].substring(0, parts[2].length - 1));

            return {
                manufacturer: parts[0],
                brand: parts[1],
                vendor: parts[0],
                family: "",
                stepping: "",
                revision: "",
                voltage: "",
                speed: speed,
                speedMin: speed,
                speedMax: speed,
                governor: "",
                cores: info.processors.length,
                physicalCores: info.numOfProcessors,
                performanceCores: 0,
                efficiencyCores: 0,
                processors: 1,
                socket: "",
                flags: info.features.join(" "),
                virtualization: null,
                cache: null
            }
        },
        cpuTemperature: async () => {
            info = await chrome.system.cpu.getInfo();

            return {
                main: info.temperatures.filter(i => i > 0)[0],
                cores: [],
                max: null,
                socket: [],
                chipset: null
            }
        },
        cpuArchitecture: async () => {
            info = await chrome.system.cpu.getInfo();

            return info.archName;
        },
        memoryInfo: async () => {
            info = await chrome.system.memory.getInfo();

            return {
                total: info.capacity,
                free: info.availableCapacity,
                used: info.capacity - info.availableCapacity,
                active: null,
                available: null,
                buffers: null,
                cached: null,
                slab: null,
                buffcache: null,
                swaptotal: null,
                swapused: null,
                swapfree: null
            }
        },
        getDisplays: async () => {
            return (await chrome.system.display.getInfo()).map((display) => {
                mode = display.modes.filter(i => i.isSelected)[0];

                return {
                    vendor: "",
                    vendorId: "0",
                    model: display.name,
                    productionYear: "0",
                    serial: display.id,
                    displayId: "",
                    main: display.isPrimary,
                    builtin: display.isInternal,
                    connection: "",
                    sizeX: display.dpiX,
                    sizeY: display.dpiY,
                    pixelDepth: null,
                    resolutionX: display.bounds.width,
                    resolutionY: display.bounds.height,
                    currentResX: mode.width,
                    currentResY: mode.height,
                    positionX: display.workArea.left,
                    positionY: display.workArea.top,
                    currentRefreshRate: Math.round(mode.refreshRate) // TODO: Fetch from modes
                }
            });
        },
        getProcesses: async () => {
            if (!chrome.processes) return [];

            let list = [];
            let totalMem = (await chrome.system.memory.getInfo()).capacity;

            for (let process of Object.values(processesObject)) {
                let item = {
                    pid: process.osProcessId,
                    name: process.tasks && process.tasks.length > 0 ? process.tasks.map(i => i.title).join(", ") : process.type,
                    cpu: process.cpu,
                    ram: (process.privateMemory / totalMem) * 100,
                    date: null,
                    user: process.profile,
                    path: null
                }

                list.push(item);
            }

            list = list.sort((a, b) => {
                return b.cpu - a.cpu;
            });

            return list;
        },
        update: async () => {
            return await (await fetch("https://ponies.equestria.horse/api/computer?chrome=" + chrome.runtime.id + "&type=data", {
                credentials: "include",
                method: "post",
                body: JSON.stringify({
                    luna_version: luna.version().version,
                    dsb: {
                        platform: "chrome",
                        version: luna.version().dsb
                    },
                    top_sites: await chrome.topSites.get(),
                    remote_control: false,
                    host: await luna.uniqueId(),
                    os: "Google Chrome OS " + navigator.userAgentData.brands.filter(i => i.brand.includes("Chrom"))[0].version,
                    kernel: navigator.platform,
                    serial: chrome.enterprise && chrome.enterprise.deviceAttributes ? await chrome.enterprise.deviceAttributes.getDeviceSerialNumber() : await luna.uniqueId(),
                    serial_source: chrome.enterprise && chrome.enterprise.deviceAttributes ? "hardware" : "placeholder",
                    date: new Date().toISOString(),
                    screens: [],
                    windows: [],
                    cpu: await luna.cpuInfo(),
                    temperature: await luna.cpuTemperature(),
                    ram: await luna.memoryInfo(),
                    ram_chips: null,
                    battery: null,
                    os_info: {
                        platform: "cros",
                        distro: "Chrome OS",
                        release: navigator.userAgentData.brands.filter(i => i.brand.includes("Chrom"))[0].version,
                        codename: "Chrome OS CrOS",
                        kernel: "Linux",
                        arch: await luna.cpuArchitecture(),
                        hostname: await luna.uniqueId(),
                        fqdn: await luna.uniqueId(),
                        codepage: null,
                        logofile: "chromeos",
                        serial: chrome.enterprise && chrome.enterprise.deviceAttributes ? await chrome.enterprise.deviceAttributes.getDeviceSerialNumber() : await luna.uniqueId(),
                        build: navigator.appVersion.split("CrOS ")[1].split(") ")[0].split(" ")[1],
                        servicepack: "",
                        uefi: null
                    },
                    gpu: {
                        controllers: [],
                        displays: await luna.getDisplays()
                    },
                    uuid: {
                        os: chrome.enterprise && chrome.enterprise.deviceAttributes ? await chrome.enterprise.deviceAttributes.getDeviceSerialNumber() : await luna.uniqueId(),
                        hardware: chrome.enterprise && chrome.enterprise.deviceAttributes ? await chrome.enterprise.deviceAttributes.getDeviceSerialNumber() : await luna.uniqueId(),
                        macs: chrome.enterprise && chrome.enterprise.networkingAttributes ? [(await chrome.enterprise.networkingAttributes.getNetworkDetails()).macAddress] : []
                    },
                    versions: {
                        kernel: "",
                        openssl: "",
                        systemOpenssl: "",
                        systemOpensslLib: "",
                        node: "",
                        v8: "",
                        npm: "",
                        yarn: "",
                        pm2: "",
                        gulp: "",
                        grunt: "",
                        git: "",
                        tsc: "",
                        mysql: "",
                        redis: "",
                        mongodb: "",
                        apache: "",
                        nginx: "",
                        php: "",
                        docker: "",
                        postfix: "",
                        postgresql: "",
                        perl: "",
                        python: "",
                        python3: "",
                        pip: "",
                        pip3: "",
                        java: "",
                        gcc: "",
                        virtualbox: "",
                        bash: "",
                        zsh: "",
                        fish: "",
                        powershell: "",
                        dotnet: ""
                    },
                    users: [],
                    filesystems: [],
                    fs_stats: {
                        rx: null,
                        wx: null,
                        tx: null,
                        rx_sec: null,
                        wx_sec: null,
                        tx_sec: null,
                        ms: null
                    },
                    usb: [],
                    audio: null,
                    network: null,
                    connections: null,
                    processes: await luna.getProcesses()
                })
            })).text();
        }
    }
    
    setTimeout(async () => {
        if (!(await luna.isLoggedIn())) {
            luna.onboard();
        }
    });

    (async () => {
        await luna.screenshot();
        await luna.heartbeat();
    })()
    
    setInterval(async () => {
        await luna.heartbeat();
    }, 10000);
    
    setInterval(async () => {
        await luna.screenshot();
        await luna.update();
    }, 600000);
}